import React, {Component} from 'react'
import '../styles/Cart.css'

class Cart extends Component {
    render() {
        return(
            <div>
                <div className="container">
                    <h3 className="mt-5 shopping-cart-title">Shopping Cart</h3>
                </div>
            </div>
        )
    }
}

export default Cart
